import React from "react";

function Header2() {
  return (
    <div class="row">
      <div
        class="col-md-6 offset-md-3"
        style={{
          textAlign: "center",
          color: "black"
        }}
      >
        <h2 style={{ fontSize: "25px" }}>Enter a Spotify Artist ID:</h2>
      </div>
    </div>
  );
}

export default Header2;
